import React from "react";

const Animation = () => {
  return (
    <svg
      width="500px"
      height="500px"
      viewBox="0 0 500 500"
      preserveAspectRatio="none"
    >
      <path className="morph">
        <animate
          attributeName="d"
          values="M 70.710678,404.03551 258.59905,63.6141 424.26407,392.92383 Z; M 70.710678,404.03551 415.17269,299.9898 l 9.09138,92.93403 z; M 70.710678,404.03551 258.59905,63.6141 424.26407,392.92383 Z"
          // from="M 70.710678,404.03551 258.59905,63.6141 424.26407,392.92383 Z"
          // to="M 70.710678,404.03551 415.17269,299.9898 l 9.09138,92.93403 z"
          dur="2s"
          repeatCount="indefinite"
        ></animate>
        <animate
          attributeName="fill"
          values="blue; red; blue"
          dur="2s"
          repeatCount="indefinite"
        ></animate>
      </path>
    </svg>
  );
};

export default Animation;
